import React, { useState, useEffect } from "react";
import { Table, Badge, ProgressBar, Container } from 'react-bootstrap';
import { FaCheckCircle } from 'react-icons/fa';
import axios from "axios";
import './style.css';


const App = () => {
  const [members, setMembers] = useState([]);
  const queryParams = new URLSearchParams(window.location.search)
  const cupom = queryParams.get("cupom")

  useEffect(() => {
    const fetchMembers = async () => {
      await axios.get(
        "https://jsonplaceholder.cypress.io/todos?_limit=10"
      ).then((result) => {
        setMembers(result.data);
      });
    };

    fetchMembers();
  }, []);

  return (
    <main className="ContainerApp">
    <div>
      <a href="logo-pulpa.png"></a>

    </div>  
    <div className="App">
      <Table striped bordered hover>
        <thead className="Table">
          <tr class name="">
            <th>Nome</th>
            <th>E-mail</th>
            <th>Cadstro?</th>
            <th>Pulpilo?</th>
            <th>Aporte?</th>
            <th>Pagamento?</th>
            <th>Progresso</th>  
          </tr>
        </thead>
        <tbody>
          {members.map((member) => (
            <tr>
              <td>{member.title}</td>
              <td> <FaCheckCircle /> </td>
              <td> <Badge bg="success">Success</Badge>  </td>
              <td> ----- </td>
              <td> ----- </td>
              <td> ----- </td>
              <td> <ProgressBar now={60} /> </td>
            </tr>
          ))}
        </tbody>
      </Table>
    </div>
    </main>
  );
}

export default App;
